import React from 'react';
import Sidebar from '../Core/Sidebar/sidebar';
import Header from '../Core/Headers/Headers';
import styled from 'styled-components';
import PropTypes from 'prop-types';
const Form = styled.form`
	background-color: white;
	margin-left: 130px;
	margin-right: 100px;
	margin-top: 10px;
	border-radius: 10px;
`;
const AddNew = () => {
	const addNewForm = () => (
		<Form>
			<div className="addform">
				<label class="form-label">Full Name</label>
				<input
					type="text"
					class="form-control"
					id="exampleInputEmail1"
					aria-describedby="emailHelp"
					placeholder="Name"
				/>
				<label class="form-label">Email</label>
				<input
					type="Email"
					class="form-control"
					id="exampleInputEmail1"
					aria-describedby="emailHelp"
					placeholder="Name"
				/>
				<label class="form-label">Phone</label>
				<input type="text" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
				<label class="form-label">Address</label>
				<textarea class="form-control" placeholder="Leave a comment here" id="floatingTextarea2" rows="3" />
				<select className="form-control" placeholder="Category">
					<option selected>Department</option>
					<option value="1">One</option>
					<option value="2">Two</option>
					<option value="3">Three</option>
				</select>
				<select className="form-control " placeholder="Category">
					<option selected>Position</option>
					<option value="1">One</option>
					<option value="2">Two</option>
					<option value="3">Three</option>
				</select>

				<input class="form-check-input" type="checkbox" value="" id="flexCheckDefault" />
				<label class="form-check-label " for="flexCheckDefault">
					Salary Paid
				</label>
			</div>
		</Form>
	);
	return (
		<div>
			<Header />
			<div className="row">
				<div className="col-sm-3">
					<Sidebar />
				</div>
				<div className="col-sm-7 dptform">{addNewForm()}</div>
			</div>
		</div>
	);
};

AddNew.propTypes = {};

export default AddNew;
